import React, { Component } from '../node_modules/react';
import './App.css';
import Notifications from './components/Notifications'
import axios from 'axios';

class App extends Component {

  state ={
    Notifications: []
  }

  componentDidMount()
 {
  axios.get('http://localhost:3001/api/notifications').then(res => {this.setState({Notifications: res.data})})

  //axios.get('http://localhost:3001/api/notifications/:id')
  //.then(res => {this.setState({Notifications: res.data})
  //})
  // axios.post('')
 }


  //this.setState

  render() {
    return (
      <div className="App">
        <h1>
        <Notifications Notifications={this.state.Notifications}/>
        </h1>
      </div>
    );
  }
}

export default App;
